import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
const footerStyle = {  
    position: 'absolute',
    bottom: '0',
    width: '100%',
    height: '60px',
    lineHeight: '60px',
    backgroundColor: '#f5f5f5' 
  };  
function Footer(){
    return(
        <footer className="footer text-center" style={footerStyle}>
            <a href="/report" className="px-3" style={{float:"left"}}>Report an issue</a>
            Copyright &#169;<b></b>The Service Man
        </footer>
    );
}
export { Footer };
